import React from "react";
import { Container, Row, Col, Jumbotron } from "reactstrap";

function Home() {
    return (
        <Container>
            <Row>
                <Col>
                    <Jumbotron>
                        <h1 className="display-3">The World of Westeros</h1>
                        <p className="lead">Welcome to the fascinating world of Westeros.</p>
                    </Jumbotron>
                </Col>
            </Row>
        </Container>
    );
}

export default Home;
